import React from "react";

export default class Login extends React.Component {
  
  state = {
    Show: false,
    Showing: false
  };

  
	

  
  show = () => {
    if (this.state.Showing) return;

    this.setState({ Show: true, Showing: true });
    setTimeout(() => {
      this.setState({ Show: false, Showing: false });
    }, 3000);
  };

  
  constructor(props){
    super(props);

    this.state = {       
            email: '',      
            password:'',
            users: [],
            email_error:'', 
            email_color:'black', 
            pass_error:'',
            pass_color:'black', 
            redirect: false,
            message:'',
            pop:'',    
    };
  }
  componentDidMount() { }
  render() {
    return (
      <>
      Login 
      </>
    );
  }
}
